import React from 'react';
import { Container, Typography, Button, AppBar, Toolbar, Grid } from '@mui/material';
import { useNavigate } from 'react-router-dom';

function LandingPage() {
  const navigate = useNavigate();

  return (
    <>
      <AppBar position="static">
        <Toolbar>

          <Button color="inherit" onClick={() => navigate("/signup")}>Sign Up</Button>
          <Button color="inherit" onClick={() => navigate("/signin")}>Sign In</Button>
        </Toolbar>
      </AppBar>
      <Container maxWidth="lg">
        <Grid container spacing={2} justifyContent="center" alignItems="center" style={{ minHeight: '80vh' }}>
          <Grid item xs={12}>
            <Typography variant="h3" align="center" gutterBottom>
              Welcome to Anaemic-Prediction
            </Typography>
          </Grid>
          <Grid item xs={12}>
            <Typography variant="h6" align="center" paragraph>
              This is a website where you can upload your image and we will predict whether you have anemia or not. Our machine learning model is trained to detect anemia from images.
            </Typography>
          </Grid>

        </Grid>
      </Container>
    </>
  );
}

export default LandingPage;
